    # assert xs[-1] != 0, "xs must have largest coefficient as non zero"
    # assert all([coeff == 0 for coeff in xs if coeff != 0]), "xs must have only one non zero coefficient"

    def poly(xs, x):
        return sum([coeff * math.pow(x, i) for i, coeff in enumerate(xs)])

    def derivative(xs, x):
        return sum([i * coeff * math.pow(x, i - 1) for i, coeff in enumerate(xs)])

    def find_zero(xs, x, epsilon=1e-6):
        if abs(poly(xs, x)) < epsilon:
            return x
        return find_zero(xs, x - poly(xs, x) / derivative(xs, x))

    return find_zero(xs, 1)


