def closest_integer(value):
    '''
    Create a function that takes a value (string) representing a number
    and returns the closest integer to it. If the number is equidistant
    from two integers, round it away from zero.

    Examples
    >>> closest_integer("10")
    10
    >>> closest_integer("15.3")
    15

    Note:
    Rounding away from zero means that if the given number is equidistant
    from two integers, the one you should return is the one that is the
    farthest from zero. For example closest_integer("14.5") should
    return 15 and closest_integer("-14.5") should return -15.
    '''
    value = float(value)
    if value % 1 == 0:
        return int(value)
    else:
        if value > 0:
            return int(value + 0.5)
        else:
            return int(value - 0.5)

def histogram(test):
    """Given a string representing a space separated lowercase letters, return a dictionary
    of the letter with the most repetition and containing the corresponding count.
    If several letters have the same occurrence, return all of them.

    Example:
    histogram('a b c') == {'a': 1, 'b': 1, 'c': 1}
    histogram('a b b a') == {'a': 2, 'b': 2}
    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}

    """
    test = test.split(' ')
    test = [x.lower() for x in test]
    test.sort()
    test = [x for x in test if len(x) > 0]
    test = [x for x in test if x.isalpha()]
    if len(test) == 0:
        return {}
    test_count = {}
    for x in test:
        if x in test_count:
            test_count[x] += 1
        else:
            test_count[x] = 1
    test_max = max(test_count.values())
    test_max = [k for k, v in test_count.items() if v == test_max]
    return {x: test_count[x] for x in test_max}

